        thumb: '/path/to/icon'
    },
    {
        id: 'list-2',
        title: 'Automatic',
        thumb: '/path/to/icon'
    },
    {
        id: 'list-3',
        title: 'Automatic',
        thumb: '/path/to/icon'
    },
    {
        id: 'list-4',
        title: 'Automatic',
        thumb: '/path/to/icon'
    }
];

const TaskList = styled.div`
    padding: 8px;
`;
const Item = styled.div`
    padding: 8px;
    border: 1px solid gray;
    margin:  2px;
`;

