                                return (
                                <Draggable draggableId={id}>
                                    <Item key={id}>
                                        {index+1 +". "}
                                        { title }

                                    </Item>
                                </Draggable>
                                );
                            })}
                            {provided.placeholder}
                    </TaskList>

                )}
            </Droppable>
    </DragDropContext>
  )
}

export default DraggableList;
